using System;

public class Aluno
{
    // Atributos da classe
    private string nome;
    private int matricula;
    private double nota1;
    private double nota2;
    private string curso;

    // Construtor
    public Aluno(string nome, int matricula, double nota1, double nota2, string curso)
    {
        this.nome = nome;
        this.matricula = matricula;
        this.nota1 = nota1;
        this.nota2 = nota2;
        this.curso = curso;
    }

    // M√©todos que retornam dados
    public string GetNome()
    {
        return nome;
    }

    public int GetMatricula()
    {
        return matricula;
    }

    public double GetNota1()
    {
        return nota1;
    }

    public double GetNota2()
    {
        return nota2;
    }

    public string GetCurso()
    {
        return curso;
    }

    public double CalcularMedia()
    {
        return (nota1 + nota2) / 2;
    }

    public string SituacaoAluno()
    {
        double media = CalcularMedia();
        return media >= 7 ? "Aprovado" : "Reprovado";
    }

    public string DadosCompletos()
    {
        return $"Nome: {nome}, Matr√≠cula: {matricula}, Curso: {curso}";
    }

    public string NotasFormatadas()
    {
        return $"Nota 1: {nota1}, Nota 2: {nota2}";
    }

    public string MediaFormatada()
    {
        return $"M√©dia: {CalcularMedia():F2}";
    }
}

public class Animal
{
    // Atributos (campos privados)
    private string nome;
    private string especie;
    private int idade;
    private double peso;
    private string habitat;

    // Construtor
    public Animal(string nome, string especie, int idade, double peso, string habitat)
    {
        this.nome = nome;
        this.especie = especie;
        this.idade = idade;
        this.peso = peso;
        this.habitat = habitat;
    }

    // M√©todos

    public string Descricao()
    {
        return $"{nome} √© um(a) {especie} com {idade} anos, pesando {peso}kg, que vive no {habitat}.";
    }

    public bool EstaNaNatureza()
    {
        return habitat.ToLower() != "domesticado" && habitat.ToLower() != "casa";
    }

    public string FaixaEtaria()
    {
        if (idade < 2) return "Filhote";
        if (idade < 7) return "Adulto";
        return "Idoso";
    }

    public string ClassificacaoPeso()
    {
        if (peso < 5) return "Muito leve";
        else if (peso < 20) return "Leve";
        else if (peso < 100) return "M√©dio";
        return "Pesado";
    }

    public string InformacoesRapidas()
    {
        return $"Nome: {nome}, Esp√©cie: {especie}, Habitat: {habitat}";
    }

    public string FichaVeterinaria()
    {
        return $"Paciente: {nome}\nEsp√©cie: {especie}\nIdade: {idade} anos\nPeso: {peso} kg\nHabitat: {habitat}";
    }

    public string Identificacao()
    {
        return $"{especie.ToUpper()} - {nome.ToLower()}";
    }

    public string OndeVive()
    {
        return $"{nome} normalmente vive em: {habitat}";
    }

    public string Som()
    {
        return $"{nome} emite um som t√≠pico de um(a) {especie}.";
    }

    public string Status()
    {
        return idade > 10 ? "Animal em idade avan√ßada." : "Animal em idade ativa.";
    }
}

