int days_number(int year, int month, int day) {
    int days_in_month[] = { 31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31 };
    if (year % 4 == 0) {
        days_in_month[1] = 29;
    }
    int total_days = 0;
    for (int i = 0; i < month - 1; ++i) {
        total_days += days_in_month[i];
    }
    total_days += day;
    return total_days;
}
