#include  <iostream>
#include      <list>
#include     <ctime>
#include   <iomanip>
#include   <cstdlib>
using namespace std;


void monitor(list<int> &r);

//////////////////////////////////////////////////////////////  27, 195
int main()                                                  //  
{ 

    srand(time(0));

 	list<int> L_1;
    
    int n = 0;

   
	for(int i = 0; i < 20; i++)
	{

		
		n = rand()%200;
		
		L_1.push_back(n); 
		
	}
	
    monitor(L_1);

}





///////////////////////////////////////////////////////////////
void monitor(list<int> &r)
{
	
     int   n_min = 0,
           n_Max = 0,	
           n        ;

    list<int>::iterator it;
    
    it = r.begin();

	for(int i = 0; i < 20; i++)
	{
		n = *it;
           
        cout << setw(3) <<  i << ") n = " << setw(3) << n << endl;   
        
		if( i == 0 ) n_min = n_Max = n;
		else
		{
		    if(n > n_Max) n_Max = n;
		    if(n < n_min) n_min = n;		    
	    } 
		
		it ++; 
    }	         
	cout << " - - -  - - - -  - - - \n";
	cout << "n_Max = " << n_Max << endl;
	cout << "n_min = " << n_min << endl;		
}
